    line-height: @17px;
    color: rgba(0, 0, 0, 0.2);
    margin-bottom: @7px;
  }
  &-withdrawn-balance {
    display: flex;
    align-items: center;
    font-weight: bold;
    font-size: @30px;
    line-height: @36px;
    color: #514f7a;
    svg {
      width: @28px;
      height: @26px;
      margin-right: @4px;
    }
