  }
  &-transaction-name {
    font-weight: 600;
    font-size: @16px;
    line-height: @19px;
    color: #fff;
    margin-bottom: @4px;
  }
  &-transaction-label {
    font-weight: 600;
    font-size: @14px;
    line-height: @17px;
    color: rgba(255, 255, 255, 0.7);
  }
}
